INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'Xtreme Tekno LLC is the leading provider of the highest quality voice, data, video, fire alarm, access control, and security system services in the Chicagoland area. We service Cook, DuPage, Lake, Will, McHenry, Boone, Kendall, Kankakee, and Northwest Indiana counties. LVS, Inc. specializes in design-build electrical and low voltage systems. The "LVS Difference" begins with our highly skilled technical and support staff that follows through with the most cost effective and power efficient solutions to suit your needs. Over the past fifteen years, we have earned our reputation of being an electrical and telecommunications contractor with high integrity, quality, safety best practices, and prompt responsiveness to customer needs. When it comes to your voice and data network, audio, video, access control, fire alarm or security systems, call on Low Voltage Solutions and see why we''re number one in the entire Chicagoland Area\r\n\r\n"Xtreme Tekno LLC provides the highest quality service in the industry"', '', 'filtered_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'Products\r\n\r\nFrom elegant one-touch lighting to sleek touch screens, Control4 offers beautiful products that create intuitive automation solutions for your smart home. Explore our most popular categories by browsing the links below.', '', 'filtered_html'),
('node', 'page', 0, 3, 3, 'und', 0, 'What we do:\r\n\r\nRS Cable Systems designs and installs electronics systems for homes and businesses. These include home theaters, distributed audio/video, lighting and climate control, communications, and home networks. You’ll find our systems in private homes, retail stores, restaurants, boardrooms... anywhere quality sound, video, and control are desired. Our systems make use of the finest consumer, professional, and industrial products, giving us the resources and flexibility to meet every individual requirement.\r\n\r\nOur proposals are straightforward, cost-effective, and responsive to your exact needs. Every project includes our continued support after the system is up and running.\r\n\r\nWe work for you :\r\n\r\nRS Cable Systems has been in business for over five years. Our fine reputation is evidenced by the referrals we enjoy from existing clients and professional colleagues. Our customers are our first responsibility; anticipating and servicing their needs is our top priority. That''s why – besides our core business – we also act as "client representatives." ', '', 'filtered_html'),
('node', 'page', 0, 5, 5, 'und', 0, 'Yasser Ramos Hernandez\r\nyasser@xtremetekno.com\r\n\r\nYasser Ramos Hdez\r\nXtreme Tekno. LLC\r\nPh: (786)273-2888', '', 'filtered_html');
